import React, { Component } from 'react';


class Skill extends Component {
    
    state = { logosrc,width,height}
    render(){
        return(
            <object type="image/svg+xml" data={logosrc} width={width} height={height} alt="Fail"></object>
        )
        }
    
}

export default Skill
